

self.onmessage = function(e) {
    const { imData, width, height, xBlockSize, yBlockSize } = e.data;
    let colorsAvg = calculateAVGColors(imData, width, height, xBlockSize, yBlockSize);
    const {allColors, colorDetails} = cluster(colorsAvg, width, height, xBlockSize, yBlockSize);
      
    self.postMessage({ allColors, colorDetails });
  };

  //esta función encuantra el promedio de colore de cada bloque
  //despues se usa Kmeans para llevarlo a 30
  function calculateAVGColors(imData, width, height, xBlockSize, yBlockSize){
    let allColors = [];
    for (let y = 0; y < height; y += yBlockSize) {
      for (let x = 0; x < width; x += xBlockSize) {
        let red = 0;
        let green = 0;
        let blue = 0;
        let alpha = 0;
        let numPixels = 0;

        for (let dy = 0; dy < yBlockSize; dy++) {
          for (let dx = 0; dx < xBlockSize; dx++) {
            if (x + dx < width && y + dy < height) {
              let offset = 4 * ((y + dy) * width + (x + dx));
              let redValue = imData[offset];
              let greenValue = imData[offset + 1];
              let blueValue = imData[offset + 2];
              let alphaValue = imData[offset + 3];

              if (alphaValue === 0) {
                continue;
              }
              red += redValue;
              green += greenValue;
              blue += blueValue;
              alpha += alphaValue;
              numPixels++;
            }
          }
        }

        if (numPixels != 0) {
          red = Math.floor(red / numPixels);
          green = Math.floor(green / numPixels);
          blue = Math.floor(blue / numPixels);
          alpha = Math.floor(alpha / numPixels);
        } else {
          red = 0;
          green = 0;
          blue = 0;
          alpha = 0;
        }
        // Add color to array
        allColors.push([red, green, blue]);
      }
    }
    return allColors;
  }

